class infosClient extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section  className="ColumnArticle">
                <span className="Numart">Numart</span>
                <span className="Libelle">Libelle</span>
                <span className="Prix">Prix</span>
            </section>
        )
    }
}
